int main(void){
    long long i,j,n,m,k,h,w,r=0,l,t,cnt=0,p,q;
    long long a[524288],b[524288],c[524288];
    rs g[2097152];
    mkj x[524288];
    sd dat[524288],wa;
    scanf("%lld%lld",&n,&m);
    for(i=0;i<m;i++){
      scanf("%lld%lld%lld",&a[i],&b[i],&c[i]);
      dat[2*i].val=a[i];
      dat[2*i].node=c[i];
      dat[2*i+1].val=b[i];
      dat[2*i+1].node=c[i];
    }
    qsort(dat,2*m,sizeof(dat[0]),sdsortfnc);
    w=0;
    dat[2*m].val=inf;
    for(i=0;i<2*m;i++){
      if(dat[i].val != dat[i+1].val || dat[i].node != dat[i+1].node){
        dat[w]=dat[i];
        w++;
      }
    }
    for(i=1;i<=n;i++){
      dat[w+i-1].val=i;
      dat[w+i-1].node=-1;
    }
    for(i=0;i<w;i++){
      g[cnt].st=i;
      g[cnt].fi=w+dat[i].val-1;
      g[cnt].kr=1;
      cnt++;
      g[cnt].fi=i;
      g[cnt].st=w+dat[i].val-1;
      g[cnt].kr=0;
      cnt++;
    }
    for(i=0;i<2*m;i++){
      wa.val=a[i];
      wa.node=c[i];
      p=sdsearch(wa,dat,w);
      wa.val=b[i];
      wa.node=c[i];
      q=sdsearch(wa,dat,w);
      g[cnt].st=p;
      g[cnt].fi=q;
      g[cnt].kr=0;
      cnt++;
      g[cnt].fi=p;
      g[cnt].st=q;
      g[cnt].kr=0;
      cnt++;
    }
    qsort(g,cnt,sizeof(g[0]),sortfnc);
    makemkj(g,x,cnt);
    printf("%lld\n",dijkstra(w,w+n-1,524288,g,x));
    return 0;
}
